import React from "react";
import Table from "./Table";

export default function MainWindow(props) {
  const title = props.title,
    items = props.items,
    likes = props.likes;
    console.log(likes.map((like)=>{like.PLAYER_ID === item.PLAYER_ID? true : false}));

  return (
    <section>
      {/* {console.log(props.likes.PLAYER_ID)} */}

      <h2>{title}</h2>
      <div className="items_list">
        {items
          ? items.map((item, key) => (
              <Table
                is_like={true}
                item={item}
                key={key}
                like={(like_data, id) => {
                  props.like(like_data, id);
                }}
              />
            ))
          : console.log("loading")}
      </div>
    </section>
  );
}
